function send-MailHtml{
    <#
    .SYNOPSIS
        Envia un correo con plantilla.
    
    .DESCRIPTION
        Envia un correo electronico con el formato de la plantilla.
        El formato esta copiado de los correos automaticos que llegan de it_notifications <it_notifications@contoso.com>.
        Al que se le ha modificado el logo, pasandolo al pie del email y no en la cabecera. 
        Se utilizan los titulos H2 y H4. 
    
    .PARAMETER Subject
        Asunto que aparecera en el email. Parametro obligatorio 
    
    .PARAMETER ListAdress
        Lista de direcciones a las que se les va a enviar. Soporta multiples direcciones. Parametro obligatorio
    
    .PARAMETER Titulo
        Texto que va a aparecer en el cuerpo del mensaje con formato titulo <H2>. Opcional
    
    .PARAMETER Message
        Texto que va a aparecer en el cuerpo del mensaje debajo del titulo con formato <p>. Opcional
    
    .PARAMETER attachment
        Archivos adjuntos al correo. 
    
    
    .EXAMPLE
        send-MailHtml -Subject "Tarea programada ejecutada" -ListAdress "alejandro.aguado@contoso.com"
        send-MailHtml -Subject "Tarea programada ejecutada" -ListAdress "alejandro.aguado@gmail.com" -Titulo "Informacion sobre tareas programadas" -Message "Esta es una tarea automatizada" -attachment "C:\temp\text.txt"
    
    
    .NOTES
        Author:  Alejandro Aguado Garcia
        Website: https://www.linkedin.com/in/alejandro-aguado-08882a31/
        Twitter: @Alejand94399487
    #> 
    
        [CmdletBinding()]
        Param(
    
              [Parameter(Mandatory = $true)]
              [String]$Subject, 
              [string[]]$ListAdress,
    
              [Parameter()]
              [ValidateNotNullOrEmpty()]
              [String]$Titulo,
              [String]$Message,
              [string[]]$attachment
        )
    
        #Datos para el correo.
        $scriptLanzado = $myInvocation.ScriptName
        $fechaEjecucion = Get-Date
        $MailSender = "Monitorizacion SCCM <automatic_sender@ext.constoso.com>"
    
        #Cuerpo del Mensaje
        $htmlBody = '<p>&nbsp;</p>
        <h2>{0}</h2>
        <p>{1}</p>
        <p>El Script: {3} se ha ejecutado correctamente.<br>
        Fecha ejecucion: {2}<br>
        Por favor es un mensaje automatizado. No responda a este correo.<br></p>
        <table style="height: 25px;" width="100%">
        <tbody>
        <tr>
        <td style="background-color: #ffd102; text-align: left;" colspan="3"><img id="DANTE" src="data:image/jpeg;base64," alt="Dante" align="left" width="293" height="103"/>
        </td>
        </tr>
        </tbody>
        </table>'
    
    
     
        if ($attachment) {
            Send-MailMessage  -From $MailSender -to $ListAdress -SmtpServer mail.prosegur.com -Subject $Subject -Attachments $attachment -BodyAsHtml ($htmlBody -f $Titulo, $Message, $fechaEjecucion, $scriptLanzado)
        }
        else {
            Send-MailMessage  -From $MailSender -to $ListAdress -SmtpServer mail.prosegur.com -Subject $Subject -BodyAsHtml ($htmlBody -f $Titulo, $Message, $fechaEjecucion, $scriptLanzado)
        }
}